import { LOCATION_CHANGE } from 'connected-react-router';
import { MEN, WOMEN } from '../types';

export function changeLocation(newLocation) {
    return {
        type: LOCATION_CHANGE,
        payload: newLocation
    }
}

export function setMen() {
    return {
        type: MEN
    }
}

export function setWomen() {
    return {
        type: WOMEN
    }
}
